    false,nt"url": null,nt"notes": "This annual narrative report for Rydell
    National Wildlife Refuge summarizes Refuge activities during the 2002 fiscal year.
    The report begins with an introduction to the Refuge and a summary of the yearu2019s
    highlights and climatic conditions. Information about monitoring and studies- including
    surveys and censuses- is provided next. Habitat restoration and management projects
    are also covered; activities include wetland restoration, upland restoration, water
    level management, haying, farming, timber management, prescribed burning, and vegetation
    control. Fish and wildlife management is discussed next with emphasis on nest structures.
    Coordination activities, such as interagency coordination and Friends organizations,
    are outlined. The resource protection section provides updates on wildfire preparedness
    and cultural resource management. Information about public education and recreation
    is given including visitor services and outreach. Finally, comprehensive management
    planning and general administration are discussed in the Refuge planning and administration
    section.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
